import Home from '../home/Home'
import { BrowserRouter, Routes, Route } from "react-router-dom";

import SearchBar from '../../components/SearchBar';

const App = () => {
    return (
        <BrowserRouter>
            <SearchBar />
            <Routes>
                <Route path="/" element={<Home />}/>
                <Route path="/search" element={<Home />}/>
            </Routes>
        </BrowserRouter>
    )
}

export default App;
